INSERT INTO `Artista` (`ArtistaId`, `Titulo`, `Descricao`, `Imagem`, `Ativo`, `md5`, `Visitas`, `mbid`, `AplicacaoId`, `Relacionados`) VALUES
(103, 'Snoop Dogg', '\n                Calvin Cordozar Broadus (Long Beach, Califórnia) Nasceu no dia 20 de Outubro de 1971 é rapper e ator norte-americano. Ganhou o apelido de &quot;Snoopy&quot; de sua mãe e adotou o nome artístico de Snoop Doggy Dogg quando começou a gravar. Atualmente é chamado de Snoop Dogg. Já atuou em filmes como The Wash, Prá lá de Bagdá, Dia de Treinamento, Hot Girls, Bones e Festa no Ar. Suas músicas mais conhecidas são: &quot;Gin And Juice&quot;, &quot;Who I Am (What''s My Name?)&quot;, &quot;Still A G Thang&quot;, &quot;Bitch Please&quot;, &quot;Beautiful&quot;, &quot;Drop It Like It''s Hot&quot;, &quot;That''s That Shit&quot;, e  &quot;Sensual Seduction&quot;. \n\n        ', 'http://userserve-ak.last.fm/serve/252/73291242.png', 1, 'c630696fa1aed1d52f40c8bb18fc2580', 0, '17d17695-f0e1-46fd-815f-bf577cc5f50d', 0, NULL),
(104, 'Snoop Dogg & Wiz Khalifa', '', 'http://userserve-ak.last.fm/serve/252/71272344.png', 1, 'bc1876ec3f5b9641ec26f7b65c8179ea', 0, '', 0, NULL),
(105, 'The Doors', '\n                The Doors foi uma banda de rock estadunidense dos fins da década de 1960 e princípio da década de 1970. O grupo era composto por Jim Morrison (vocal), flamenco entre outros.  Canções como &quot;Break on Through (To the Other Side)&quot;, &quot;Light My Fire&quot;, &quot;People Are Strange&quot; e &quot;Riders on the Storm&quot;, aliadas à personalidade e escândalos protagonizados por Jim Morrison, contribuíram de sobremaneira para o aumento da fama do grupo. \n\n        ', 'http://userserve-ak.last.fm/serve/252/18012809.jpg', 1, '1cd3042b099ebcd523c195fea00aa19b', 0, '9efff43b-3b29-4082-824e-bc82f646f93d', 0, NULL),
(106, 'The Boys Next Door', '\n                Tudo começou em 1973, quando Nick Cave era aluno da Caulfield Grammar School e resolveu formar uma banda com os amigos.  Tendo grande influência o glitter praticado por David Bowie, Lou Reed, Alice Cooper, Roxy Music, Cave se juntou ao guitarrista Mick Harvey e ao baterista Phil Calvert, com membros flutuantes nos demais instrumentos.  O grupo começou a tomar forma quando o guitarrista Tracey Pew juntou-se ao combo em 1975 e, em 1976, nascia o The Boys Next Door, inspirado nos grupos punk locais como The Saints.\n\n        ', 'http://userserve-ak.last.fm/serve/252/12352293.jpg', 1, '1e513d4be6ad22945e12e0be544fda1a', 0, '5a7a3629-e608-4fce-887a-a9028eef1c72', 0, NULL),
(107, 'Jim Morrison', '\n                James Douglas Morrison, mais conhecido como Jim Morrison, (Melbourne, Flórida, Estados Unidos, 8 de Dezembro de 1943 - Paris, 3 de Julho de 1971) foi um cantor, compositor e poeta norte-americano.\n Foi o vocalista e autor da maior parte das letras da banda rock norte-americana Robby Krieger também tenha escrito algumas com Jim, por exemplo, Light My Fire.  Jim Morrison era filho do almirante George Stephen Morrison e sua mulher Clara Clark Morrison, ambos funcionários da marinha americana.\n\n        ', 'http://userserve-ak.last.fm/serve/252/16417817.jpg', 1, '8e244b239467a327b780e6a0a76c7fd6', 0, 'c6619f89-5454-4e2d-aa19-b5596ba3b4c6', 0, NULL),
(108, 'Jim Morrison & Music By The Doors', '\n                An American Prayer (ou An American Prayer: Jim Morrison &amp; The Doors) é o nono álbum de estúdio da banda Jim Morrison (originalmente gravadas em uma sessão de poesia de Jim, em 1970). O resultado foi este álbum. A poesia de Morrison foi considerada demasiadamente rústica para os anos 60. O álbum recebeu diversas revisões e é considerado incomum até hoje.\n\n        ', 'http://userserve-ak.last.fm/serve/252/49328601.png', 1, 'ac084fc5b7105e68ca58ee126637de0b', 0, '', 0, NULL),
(109, 'Sex Pistols', '\n                Sex Pistols foi uma célebre banda inglesa de punk rock, formada em Londres, no ano de 1975. Embora não tenham sido a primeira banda de punk do país, foram influentes por trazer o movimento punk do Reino Unido para a atenção mundial, e inspiraram diversos artistas posteriores de punk e rock alternativo. Sua carreira durou apenas dois anos e meio, e produziu apenas quatro singles e um álbum de estúdio, Never Mind the Bollocks, Here''s the Sex Pistols.\n \n\n        ', 'http://userserve-ak.last.fm/serve/252/2244366.jpg', 1, '3f03047fb51a6f4c121f90470272c392', 0, '49855822-68b4-4dff-aec7-642546611518', 0, NULL),
(110, 'Cansei de Ser Sexy', '\n                Cansei de Ser Sexy (agora conhecida pela abreviação CSS) é uma banda brasileira formada em São Paulo, Brasil em 2003. Mistura influências de indie rock, pop, música eletrônica e outros tipos de arte como design e moda. É uma das bandas brasileiras de maior visibilidade internacional caracterizando-se pela sua postura despreocupada e alternativa.  Após gravar alguns discos caseiros, a banda foi contratada pela Sub Pop e lançou dois discos de estúdio: &quot;Donkey&quot;  (2008).\n\n        ', 'http://userserve-ak.last.fm/serve/252/64987348.png', 1, 'c9251d78f48bfb82dda4963df018cfc1', 0, '', 0, NULL),
(111, 'Ramones', '\n                Os Ramones (Queens, Nova Iorque, Estados Unidos) foram uma banda estadunidense de Johnny Ramone (pseudônimo de John Cummings) na guitarra.  \n\n        ', 'http://userserve-ak.last.fm/serve/252/6700337.jpg', 1, 'c3792c84fb35aa24c795b9a3788ae488', 0, 'd6ed7887-a401-47a8-893c-34b967444d26', 0, NULL),
(112, 'A Tribute To Ramones', '\n                “Nunca diga não para um cara que tem Zombie no nome”. Com esta frase Stephen King (um dos mestres do suspense) começa seus comentários sobre o tão aguardado tributo aos pais do Punk (junto com Iggy Pop e Stooges e uma pá de bandas), que foi adiado pelo menos quatro vezes devido a mudanças no “cast”. Mas Mr. Rob Zombie se mostra um cara paciente e perseverante e com a ajuda de Johnny Ramone consegue reunir um grupo estelar de artistas para prestar uma homenagem a uma das bandas mais legais da face da Terra. (Vai dizer que você nunca ouviu Ramones na vida???).\n \n\n        ', 'http://userserve-ak.last.fm/serve/252/2676737.jpg', 1, '80126bf605c82752121010fd7575be48', 0, '', 0, NULL),
(113, 'GOT WHAT YOU NEED', '', '', 1, '16191b7d5ad2f3e74101a210e0e11742', 0, '', 0, NULL),
(114, 'I Got What You Need', '', '', 1, '9f14c3d256a99d3668e1dfa73ea6f6be', 0, '', 0, NULL),
(115, 'Motörhead', '\n                Motörhead é uma banda de rock ''n'' roll que, por seu peso e velocidade, influênciou muitas bandas de heavy metal, especialmente de thrash metal, punk rock e hardcore. Foi formada em 1975 na Grã-Bretanha pelo vocalista e baixista Lemmy Kilmister.   Desde então, a banda se encontra em atividade e já lançou 26 discos ao longo de sua carreira, todos seguindo a mesma linha de som: rock ''n'' roll simples, bruto e pesado. O auge da banda foi durante o final dos anos 70 e início dos anos 80, com os discos &quot;Overkill&quot;, &quot;Bomber&quot;, &quot;Ace Of Spades&quot; e o ao vivo &quot;No Sleep ''Til Hammersmith&quot;.  \n\n        ', 'http://userserve-ak.last.fm/serve/252/395379.jpg', 1, 'e6fee4a1e57ca26e9d1b5764fc14ef26', 0, '57961a97-3796-4bf7-9f02-a985a8979ae9', 0, NULL),
(116, 'Black Rebel Motorcycle Club', '\n                Black Rebel Motorcycle Club, ou B.R.M.C., é uma banda de rock psicodélico de San Francisco, California criada em 1998. Residem atualmente em Los Angeles. A atual formação é Robert Levon Been, Peter Hayes e Leah Shapiro. Nick Jago, antigo bateirista, saiu da banda para dedicar-se a um projeto solo. Suas influências vão desde The Jesus and Mary Chain.\n\n        ', 'http://userserve-ak.last.fm/serve/252/14631.jpg', 1, '24cfbd213f3cd5acbb6aac3309c0a0c5', 0, '32b90c92-9978-4a07-90eb-caa4b22f4907', 0, NULL),
(117, 'The Motorhomes', '', 'http://userserve-ak.last.fm/serve/252/10682.jpg', 1, '9f309a7dacbb8d257115bac760f4efad', 0, '9c42045f-8e46-4b0e-9540-928bf4000b73', 0, NULL),
(118, 'Motörhead vs. Noisia', '\n                DJ Hero é um jogo musical desenvolvido pela FreeStyleGames e publicado pela Activision.  Foi lançado na América do Norte a 27 de outubro de 2009 e foi lançado na Europa a 27 de outubro de 2009 para a PlayStation 2, PlayStation 3, Wii e para a Xbox 360.  DJ Hero é parecido com o Guitar Hero, a diferença que ele simula o Turntablism, técnica de DJs.\n\n        ', 'http://userserve-ak.last.fm/serve/252/37891021.jpg', 1, '0271b8baf255b29bbe20aad908fb9193', 0, '', 0, NULL),
(119, 'Luciano Pavarotti', '\n                Luciano Pavarotti (Módena, 12 de Outubro de 1935 — Módena, 6 de Setembro de 2007) foi um cantor lírico italiano, grande intérprete das obras de Donizetti, Puccini e Verdi.  Pavarotti participou com os tenores espanhóis José Carreras e Plácido Domingo nos concertos &quot;Os três tenores&quot;, e gravou famosos duetos com Mariah Carey, Bryan Adams, Andrea Bocelli, Céline Dion, U2 e Roberto Carlos, entre outros. É considerado um dos mais importantes tenores de todos os tempos.\n\n        ', 'http://userserve-ak.last.fm/serve/252/225601.jpg', 1, '86216312db0a4e360d11e38a489e49d8', 0, '705076ef-a0c5-472f-bebd-3e72174fcaf4', 0, NULL),
(120, 'Dennis Pavao', '', 'http://userserve-ak.last.fm/serve/252/604387.jpg', 1, '8f92954e64ed9ef260f758c881f68e31', 0, '7a5ae951-ad5a-4474-b7bc-cd3f556b884a', 0, NULL),
(121, 'Skazy Lesa', '', 'http://userserve-ak.last.fm/serve/252/9588219.jpg', 1, 'f72af020a6268e0fce314773c6a57455', 0, '', 0, NULL),
(122, 'Dj Skazy', '', '', 1, '9d0eff12dfaf374fff481c4d1deb64dc', 0, '', 0, NULL),
(123, 'Skazi', '\n                O projeto Skazi é formado pela dupla israelense Asher Swissa (guitars) e B - Bass (synths), que fundaram a &quot;sub-vertente hard core psytrance&quot;. Em suas criações a dupla criou um estilo único de psytrance, usando muitas guitarras, synths poderosos e batidas pesadas. Skazi tem um estilo bem diferente dos demais, tornando-os amados em todo o mundo. Essa dupla se apresenta nas melhores raves incluindo Japão, Rússia, Estados Unidos, Alemanha, Israel e na grande XXXPerience (Brasil).\n\n        ', 'http://userserve-ak.last.fm/serve/252/48498055.jpg', 1, '23cbfa333bc1c123b990185b75bd9376', 0, '8d62a782-3c12-4067-9bce-80fd91ddd5c0', 0, NULL),
(124, 'Skazi and Big Fishi', '', '', 1, '64b16166ab19297f365802bd0a14bd34', 0, '', 0, NULL),
(125, 'Bruce Springsteen', '\n                Bruce Frederick Joseph Springsteen, nascido dia 23 de Setembro de 1949 em Long Branch, New Jersey, Estados Unidos, apelidado de &quot;The Boss&quot; é um cantor e compositor americano que tem como banda de apoio a E Street Band. Começou sua carreira em 1969. Springsteen é conhecido por suas letras patrióticas, poéticas, e sentimentos de afeição por sua terra natal, New Jersey.  Em 1965, apresentava-se no Greenwich Village em New York formado bandas como Steel Mill e Dr. Zoom and The Sonic Boom.   \n\n        ', 'http://userserve-ak.last.fm/serve/252/16942741.jpg', 1, '028ad117957abbd88338ffb194af59fb', 0, '70248960-cb53-4ea4-943a-edb18f7d336f', 0, NULL),
(126, 'Bruno Mars', '\n                Peter Gene Hernandez (Honolulu, Havaí 8 de Outubro de 1985), mais conhecido pelo nome artístico The Lazy Song&quot; foi a décima canção mais vendida com 6,5 milhões, somando os três singles venderam mais de 28 milhões de cópias.\n\n        ', 'http://userserve-ak.last.fm/serve/252/66688938.png', 1, 'ce178f34069e29a506c407052db01ca7', 0, 'afb680f2-b6eb-4cd7-a70b-a63b25c763d5', 0, NULL),
(127, 'Tiësto', '\n                DJ Tiësto, nome artístico de Tijs Verwest, (Breda, 17 de Janeiro de 1969) é um músico e DJ de electro/progressive house dos Países Baixos.  Responsável por um grande número de músicas originais, produções e remisturas, tornou-se num dos DJs mais populares da actualidade. Para além dos seus trabalhos solo, Tiësto é reconhecido pela sua colaboração em projectos de trance com outros DJs e produtores, como Gouryella (juntamente com Ferry Corsten), Kamaya Painters (com Benno De Goeij) e Major League (com Armin van Buuren).\n\n        ', 'http://userserve-ak.last.fm/serve/252/93885399.jpg', 1, 'aed1b9acfb5a4a45d78b42658eddfd33', 0, '163a0256-f137-4b6f-8922-77941cbb9532', 0, NULL),
(128, 'Tiësto feat. C.C. Sheffield', '', 'http://userserve-ak.last.fm/serve/252/38604459.jpg', 1, '78093c9d6ae4a577c59c59041d7b7b36', 0, '', 0, NULL),
(129, 'Astrix', '\n                Astrix é Avi Shmailov, aclamado DJ e produtor Israelense de trance psicodélico (psy trance) especializado no sub-gênero Full-on. Nascido na Rússia em 1981, ele cresceu em Tel Aviv, Israel. Astrix começou a gravar suas músicas com este nome em 1997 e o tem usado desde então.  Astrix começou sua carreira como DJ em 1995 tocando música alternativa e dos anos 80. Foi durante essa época que ele começou a aprender sobre música eletrônica. Porém apenas em 1997, quando começou a gravar por conta própria, que descobriu o trance, ao ser convidado à uma festa trance. \n\n        ', 'http://userserve-ak.last.fm/serve/252/579381.jpg', 1, '26ee92d7cbf8d81eff53ab0a943edf50', 0, '13875f81-5bfc-4939-a6cc-296c3f8d0fa5', 0, NULL),
(130, 'Astrix & Atomic Pulse', '', 'http://userserve-ak.last.fm/serve/252/13275675.jpg', 1, '8041fe6508d6084d5f10e7522167a94f', 0, '', 0, NULL),
(131, 'Sesto Sento', '\n                Sesto Sento é um projeto Israelense formado por um trio: Matan Kadosh, Aviram Saharai e Itai Specto. \n Matan Kadosh também trabalha em outro projeto solo de Nome GATAKA,\n Aviram Saharai e Itai Specto recentemente lançaram um novo projeto de nome FERBI BOYS.   Sesto Sento é conhecido mundialmente por seu estilo FULL ON. Seus Lives vem conquistando cada dia mais fãs.\n \n\n        ', 'http://userserve-ak.last.fm/serve/252/35750789.jpg', 1, 'dea7140463ff9b5e3632761a4626ed29', 0, 'e3bd2490-1380-4633-a32b-e7d9f249610a', 0, NULL),
(132, 'Sesto Sento Vs Apocalypse', '', 'http://userserve-ak.last.fm/serve/252/46387951.jpg', 1, '796ae0d0312a6e8930976284fec6ff13', 0, '', 0, NULL),
(133, 'GMS', '\n                O GMS ou Growling Mad Scientists nasceu em 1995 em Amsterdam/Holanda. É formado por Riktam (Shajahan Matkin) e Bansi (Josef Quinteros, nascido em Barcelona/Espanha). Tocam em festas no mundo inteiro e já venderam mais de 200.000 discos com músicas de sua autoria, em mais de 150 álbuns e coletâneas. Sua música abre e cria fronteiras e já inspirou produtores dos quatro cantos do mundo, fazendo o GMS um dos projetos de música eletrônica mais procurados do mundo no gênero.  \n\n        ', 'http://userserve-ak.last.fm/serve/252/579518.jpg', 1, 'c1abb5469e3da9c4c90e62b396c94e28', 0, '1401c815-f4c8-4bde-9891-b44d5730850b', 0, NULL),
(134, 'GMS Vs Wrecked Machines', '', 'http://userserve-ak.last.fm/serve/252/28612233.jpg', 1, '30d910bff8ebc7886ed1c85369f03bd8', 0, '', 0, NULL),
(135, 'Infected Mushroom', '\n                Infected Mushroom é um projecto de referência no trance psicodélico formado pelos produtores e DJs israelitas Erez Eisen e Amit Duvedevani. A banda teve o seu início quando Erez, que estuda música desde os quatro anos de idade e produz música electrónica desde os onze, uniu-se a Duvdevani, após uma participação no lendário projecto Shiva Shidapu. Com um som considerado por muitos como inovador, melódico e alucinante, Infected ajudou muito no crescimento do trance psicodélico, combinando criatividade com muita técnica. \n\n        ', 'http://userserve-ak.last.fm/serve/252/70315472.jpg', 1, 'c9c92840fdb77d2e2dab9ae5fbd34d43', 0, 'eab76c9f-ff91-4431-b6dd-3b976c598020', 0, NULL),
(136, 'Infected Mushroom & Yahel', '', 'http://userserve-ak.last.fm/serve/252/25381569.jpg', 1, '8287bec9555d16b73ab5b0a9ee4e66c0', 0, '', 0, NULL),
(137, 'Infected Mushroom & Astrix', '', 'http://userserve-ak.last.fm/serve/252/85483901.jpg', 1, 'f760ac9370e3b4586bf8e1c412c011f6', 0, '', 0, NULL),
(138, 'Astrix & Dali & Infected Mushroom & Skazi & Talamaska', '', '', 1, '51dfa3f770d6a0aeda35ec85951b21e4', 0, '', 0, NULL),
(139, 'Skrillex', '\n                Skrillex é o pseudônimo usado em Los Angeles, Califórnia pelo músico americano From First to Last e outros lançamentos solo.  Vencedor de 3 Grammy''s, é DJ eletrônico e produtor de um estilo que incorpora electro house, fidget house e dubstep. Começou a produzir e performar sob o nome Skrillex em clubes na área de Los Angeles, em 2008.  \n\n        ', 'http://userserve-ak.last.fm/serve/252/66655254.png', 1, '4aa6e5705dc12007b143635a6c63087d', 0, 'ae002c5d-aac6-490b-a39a-30aa9e2edf2b', 0, NULL),
(140, 'Skrillex & Damian "Jr. Gong" Marley', '\n                A parceiria entre os dois artistas iniciou em 2011. Skrillex havia montado a música como todas suas outras, sendo uma música instrumental. Os fãs apelidaram a música de &quot;Rudeboy Bass&quot; e usaram como sample &quot;Rudeboy bass, mash up the place!&quot;. A música mais tarde foi re-editada e os vocais da música &quot;Welcome to Jamrock&quot;. Skrillex enviou uma demo para Damian Marley. Em vez de lançar a música como um remix de &quot;Welcome to Jamrock&quot;, Marley se ofereceu para gravar novos vocais, substituindo os que foram usados.\n\n        ', 'http://userserve-ak.last.fm/serve/252/77227476.jpg', 1, '2e4733c008cfe694aa84c1950d85fd54', 0, '', 0, NULL),
(141, 'Knife Party', '\n                Knife Party é a dupla de Antidote.  \n\n        ', 'http://userserve-ak.last.fm/serve/252/67404336.jpg', 1, 'ef470ff2dd483d65a2423575fe9ccd65', 0, '82a8aee6-0772-4399-9238-b5903eab413f', 0, NULL),
(143, 'Swedish House Mafia', '\n                Swedish House Mafia foi um grupo constituído por três DJs e produtores de House. Axwell, Steve Angello e Sebastian Ingrosso. &quot;O nome é apenas um pensamento aleatório.&quot;, foi assim que Steve Angello descreveu o nome do grupo, algo que ocorreu no exterior de um 7 Eleven no fim de noite, enquanto bebiam café. No inicio o nome Swedish House Mafia era utilizado como forma de brincadeira pelos membros, mas devido ao sucesso que obteve em alguns fóruns na Internet foi adotado como nome oficial.\n \n\n        ', 'http://userserve-ak.last.fm/serve/252/82777053.png', 1, '5cc0a50aa8d188b3c07687c3e89b6a03', 0, '317d0217-b3d1-447c-ab99-56f21ff93f8f', 0, NULL),
(144, 'Swedish House Mafia vs. Tinie Tempah', '', 'http://userserve-ak.last.fm/serve/252/52690751.png', 1, '96aea693ee338de608540efb59bd22b4', 0, '', 0, NULL),
(145, 'BUMP OF CHICKEN', '\n                PROFILE\n Bump of Chicken é bastante inspirado pelo The Beatles, e isso é evidente em sua música. Isso tende a passar a impressão de que eles são mais velhos do que a realidade. Enquanto algumas canções são bastante leves e meigas, eles também têm capacidade de produzir rock com pegada. Ao ouví-los fica claro que os integrantes se entendem.  BIOGRAPHY\n &quot;Vamos formar uma banda e mudar a história do rock?&quot; sugeriu Hideo Masu, com 14 anos, ao colega de aula e amigo Motoo Fujiwara, durante o segundo ano na Escola West Usai Junior High, em 1994.\n\n        ', 'http://userserve-ak.last.fm/serve/252/566930.jpg', 1, 'f35343b5554b5336f9d8382bbb81319d', 0, '0f718079-e5ea-4cfb-b512-b2d04da66901', 0, NULL),
(146, 'Bumblebeez', '\n                A banda australiana já está na estrada faz tempo, mas foi com a recente &quot;Dr. Love&quot; que ela apareceu em sets, mixtapes e compilações em todo o canto. A faixa está sendo lançada pela Modular e é um synth-pop sacana com um refrão que gruda no córtex cerebral logo de primeira (&quot;My baby''s not at home. Dr. I''ll give you a call&quot;).  O disco vem acompanhado por um remix feito por Trizzy, pseudônimo do produtor mais conhecido como A-Trak, que a deixou ainda mais amigável para as pistas de dança.\n\n        ', 'http://userserve-ak.last.fm/serve/252/17888021.jpg', 1, '9f912449f2994ddee038fd1408e85e95', 0, '7a226187-05cd-40f6-9334-dfe960007555', 0, NULL),
(147, 'Marrom', '', 'http://userserve-ak.last.fm/serve/252/84111589.jpg', 1, '62078347905e1fd341fa908e169b16e2', 0, '', 0, NULL),
(148, 'Facção Central/Marrom Capoeira e Alunos', '', '', 1, '152085cb34a2f66743a3ba58a93ae4b3', 0, '', 0, NULL),
(149, 'Screen Team (Marrom 5 Parody)', '', '', 1, '61152b4ed9524caae1114b75212ff74a', 0, '', 0, NULL),
(150, 'Maroom 5 (Maroon 5 vs Room 5)', '', '', 1, '182f0b0662cf0faf28ada475f6855b7a', 0, '', 0, NULL),
(151, 'Bruno & Marrone', '\n                (Baixe gratuitamente a música &quot;Bruno &amp; Marrone passou a ser conhecido nacionalmente.   \n\n        ', 'http://userserve-ak.last.fm/serve/252/38310827.png', 1, 'f2c0ea83b4ae15e37c8b6b56534a0d69', 0, 'f7c823d0-c49f-40d3-84c0-edc32d045ea2', 0, NULL),
(152, 'Emma Marrone', '', 'http://userserve-ak.last.fm/serve/252/88414499.jpg', 1, '9fa34f52ab694700c059d6f54bd6e4d6', 0, '', 0, NULL),
(153, 'Marron 5(ft.Christina Aguilera)', '', 'http://userserve-ak.last.fm/serve/252/77864642.jpg', 1, 'a5912a88c0c4c0affcea3de172842524', 0, '', 0, NULL),
(154, '.Marron.5.', '', '', 1, '0673e9f0c180d31bba58814bfec4641c', 0, '', 0, NULL),
(155, 'Thievery Corporation', '\n                Thievery Corporation é um grupo de Washington, DC, com base em gravação artista e DJ duo constituído por Rob Garza e Eric Hilton e apoiar os seus artistas. Sua música mistura elementos do estilo dub, acid jazz, clássica indiana e brasileira (como a bossa nova), com uma estética Lounge.  Thievery Corporation está na décima oitava Street Lounge gravadora chamado após o DC clube detida por Eric Hilton, mas vários dos seus singles e EP''s aparecem na 4AD e! K7 rótulos.  \n\n        ', 'http://userserve-ak.last.fm/serve/252/58789977.png', 1, 'f4c8277ed88f709415ece4e429466430', 0, 'a505bb48-ad65-4af4-ae47-29149715bff9', 0, NULL),
(156, 'Third Eye Blind', '\n                Third Eye Blind (frequentemente abreviada por 3EB) é uma banda estado-unidense de rock alternativo formada em 1993, na cidade de San Francisco.   Os atuais membros são: Stephan Jenkins (vocais e guitarras), Brad Hargreaves (bateria), Tony Fredianlli (guitarra e vocais) e Leo Kremer (baixo). Também compôs a banda o guitarrista Kevin Cadogan, que saiu por razões até hoje desconhecidas. Além disso, o baixista oficial da banda, Arion Salazar, tem deixado de participar dos últimos shows e vem sendo substituído por Kremer, mas não se sabe se ele entrará de vez para a banda... \n\n        ', 'http://userserve-ak.last.fm/serve/252/2723999.jpg', 1, '2cabb5d1956aec3ae36f2e9d69c7bcd3', 0, '92a42e82-b36f-4308-82c1-68bad2e03c89', 0, NULL),
(157, 'This Love', '', 'http://userserve-ak.last.fm/serve/252/51039695.png', 1, '674716cbe3cba3733c370d782ba675b5', 0, '60dacbdc-2683-42d3-8017-38923637c024', 0, NULL),
(158, 'This Love Is Deadly', '\n                This Love Is Deadly é uma banda de PJ Harvey, a banda gravou apenas um EP, no ano de 2008, o qual foi bem recebido pelos críticos alemães.  Integrantes:\n Lisa (vocal, baixo, guitarras)\n Louis (guitarras, baixo, vocal)\n www.thisloveisdeadly.com\n\n        ', 'http://userserve-ak.last.fm/serve/252/48025775.jpg', 1, '658ac51573cb7ad580c441df827b95d0', 0, 'c0a23b1c-fdef-4753-94a3-4d625a23178b', 0, NULL),
(159, 'DJ Antoine', '\n                DJ Antoine, cujo verdadeiro nome é Antoine Konrad, é um DJ e produtor suíço. Passou anos de sua carreira dedicando-se a cena Hip Hop da cidade de Basiléia, na Suíça, até mais tarde descobrir a house music e se tornar um fenômeno mundial.  Em 1999 ficou conhecido graças ao single &quot;Do It&quot;, que seria apenas o começo do seu enorme sucesso, que foi confirmado quando triunfou no Ericsson Dance Music Award 2001. Em 2005 lançou o single &quot;All We Need&quot;, que marcou presença nos charts e pistas de todo o mundo, e foi seguido pelo single &quot;Arabian Adventure&quot;, lançado no ano seguinte. \n\n        ', 'http://userserve-ak.last.fm/serve/252/49048583.jpg', 1, 'd4461ed924c1d298cdad3cb27aa5b66f', 0, '6ed36b36-b2e0-4540-bc79-0348b744cb10', 0, NULL),
(160, 'DJ Antoine vs. Timati feat. Kalenna', '', 'http://userserve-ak.last.fm/serve/252/74377642.png', 1, '96e2c6106dddc5981b8d28eb81537bfd', 0, '', 0, NULL),
(161, 'Myleene Klass', '\n                Myleene Angela Quinn ( née Klass, nascida 06 de abril de 1978) é uma cantora Inglêsa, pianista, personalidade da mídia e modelo ocasional. Ela era um ex-membro da banda britânica pop extinta Hear''Say.\n\n        Myleene Klass on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/75692000.png', 1, 'd86ec00bf2251cd0e75f289cf9faed9d', 0, '060f0ad4-9c6e-41a9-90fd-355636641971', 0, NULL),
(162, 'Klashnekoff', '', 'http://userserve-ak.last.fm/serve/252/37691769.jpg', 1, '6119c9ce7635546556ef4fae298e5d5b', 0, '6c3d622d-4807-4a71-8ffd-1f4b8b876da0', 0, NULL),
(163, 'Klaas', '\n                Klaas’ fascination of putting on electronic sounds was aroused within the Cologne club scene in the late 90ies: He debuted with several releases and approached ambitiously the art of mixing sounds. Soon after, the open-minded Cologne based DJ moved forward to the energetic electro-sound producing his first electro-vinyl Slip &amp; Slide with Micha Moor for the Cologne label Scream and Shout Recordings, which paved directly the way onto the playlists of reputable DJ celebrities. From then on, there was no way to stop him making a go of his passion. \n\n        ', 'http://userserve-ak.last.fm/serve/252/49727035.png', 1, '3d5a21b4982f1517820069a5b47895a3', 0, '30c08d4e-e8cc-41e6-901f-0f5179b5a54a', 0, NULL),
(164, 'Klaas meets Haddaway', '', 'http://userserve-ak.last.fm/serve/252/30495341.jpg', 1, 'e54b4dd74b4ddc5e0a2ea6a2dcaf19aa', 0, '23ae1449-105e-4e59-9722-4311cc03d90b', 0, NULL),
(165, 'Skank', '\n                Skank é uma banda brasileira de Pouso Alto, junto com os irmãos Dinho (bateria) e Alexandre Mourão (baixo).\n\n        ', 'http://userserve-ak.last.fm/serve/252/76448476.png', 1, '1dab05b9fa836125d776cccd73d3e8fc', 0, '25db5fde-2384-4baf-8e3d-d8299b4c99ef', 0, NULL),
(166, 'Skankin'' Pickle', '\n                Skankin'' Pickle was an American ska punk band formed by Mike Park in San Jose, California that was active from 1989 to 1996.  http://www.myspace.com/singalongwithskankinpickle\n\n        ', 'http://userserve-ak.last.fm/serve/252/21797319.jpg', 1, '97f9b181a319ceb6eecf7ff6bc474f4c', 0, 'd9b52518-0b22-4346-a534-5c73dc151310', 0, NULL),
(167, 'Stan Getz', '\n                Stanley Gayetsky (1927-1991) foi um músico do jazz conhecido como Stan Getz. Filho de pais russos-judeus e criado em Nova York, Getz tocou diversos instrumentos antes que seu pai lhe comprasse seu primeiro sax, aos 13 anos.  Em 1943 entrou para a Jack Teagarden''s band. Depois de tocar com outros conjuntos (1944 Stan Kenton; 1945 Jummy Dorsey; 1945-46 Benny Goodman), ficou conhecido como solista na Woody Herman Band (1947-49).\n\n        ', 'http://userserve-ak.last.fm/serve/252/3884497.jpg', 1, 'd7f40b15bc0f5b1f91588f0d209615f2', 0, '17ed0092-b086-4f1c-95bf-32fb79c511c5', 0, NULL),
(168, 'The Get Up Kids', '\n                The Get Up Kids é uma banda formada no final de 1994, em Kansas City.  Em 1996, a banda lança seu primeiro álbum &quot;Four Minute Mile&quot;.\n É um álbum que mostra melodias bem arranjadas,com uma pitada de crueza, honestidade, e trabalho árduo.\n o Four Minute Mile é o inicio de muita coisa para a banda.\n Após o lançamento a banda faz uma turnê pela Europa, e Estados Unidos, com mais de 200 shows de trabalho do Four Minute Mile.  \n \n\n        ', 'http://userserve-ak.last.fm/serve/252/275180.jpg', 1, '077c0c56293a31e7b3b8f6f7ee6e846d', 0, '1b54e90c-638e-4fdd-a20e-4ab09db9fdaf', 0, NULL),
(169, 'David Thomas And Two Pale Boys', '', 'http://userserve-ak.last.fm/serve/252/316027.jpg', 1, '803fd653edcc02c8de11005d10af0994', 0, 'c0979054-13b5-4868-915d-8ec42bbead73', 0, NULL),
