(171, '2Pac', '\n                Tupac Amaru Shakur, mais conhecido como 2Pac, ou apenas por Pac (Nova York, 16 de Junho de 1971 — Las Vegas, 13 de Setembro de 1996) foi um grande rapper, ator, poeta e ativista social. Suas músicas tratavam da violência, desigualdade racial e às vezes de disputas com outros rappers. Entrou para o Guinness Book como o maior vendedor de álbum de gangsta rap, com mais de 75 milhões pelo mundo (37,5 milhões somente nos Estados Unidos).  \n\n        ', 'http://userserve-ak.last.fm/serve/252/2306359.jpg', 1, '0f82983e3dd52ca55e7d21966d437014', 0, '382f1005-e9ab-4684-afd4-0bdae4ee37f2', 0, NULL),
(172, 'Johann Pachelbel', '\n                Johann Christoph Pachelbel, músico e compositor do estilo barroco, nascido na cidade alemã de Nuremberg, em 1º de setembro de 1653.  Desde cedo demonstrou talento e, incentivado pelo pai, iniciou os estudos com o músico Heinrich Schwemmer e, posteriormente, com o organista Georg Caspar Wecker. Cresceu em uma região culturalmente ativa na época, e sua excelente habilidade musical o levou, aos 15 anos, para a Universidade de Altdorf. Por lá, foi organista em Lorenzkirche, abandonando o cargo menos de um ano depois, por falta de dinheiro. \n\n        ', 'http://userserve-ak.last.fm/serve/252/193992.jpg', 1, 'b6d739c510019b0a87477d490be002f4', 0, '2251b277-2dfb-4cf1-83f3-27e29f902440', 0, NULL),
