(179, 'The Notorious B.I.G.', '\n                Christopher George Latore Wallace (21 de maio de 1972 – 9 de março de 1997), também conhecido como Biggie Smalls, Big Poppa e Frank White, mas muito mais conhecido pelo apelido The Notorious B.I.G. (Business Instead of Game), foi um rapper estadunidense muito popular que alcançou a fama em meados da década de 90.  Nascido no Brooklyn, New York. Desde jovem já traficava drogas em Bedford-Stuyvesant. Quando abandonou sua vida criminal, acabou por virar um rapper. Lançou o criticamente aclamado álbum Ready To Die em 1994, e se converteu na principal figura do rap da Costa Leste dos E.\n\n        ', 'http://userserve-ak.last.fm/serve/252/84685941.png', 1, '5be4f06e4d878927bc94c1194deae223', 0, 'd5d97b2b-b83b-4976-814a-056d9076c8c3', 0, NULL),
(180, 'The Notorious B.I.G. and Method Man', '', 'http://userserve-ak.last.fm/serve/252/81163465.jpg', 1, 'e45bd33a7df4c7e76e015f427e68ee12', 0, '', 0, NULL),
(181, 'Elvis Presley', '\n                Elvis Aaron Presley, ou simplesmente Elvis Presley (East Tupelo, Mississippi, Estados Unidos, 8 de Janeiro de 1935 — Memphis, Tennessee, Estados Unidos, 16 de Agosto de 1977) foi um famoso cantor, músico, ator e dançarino denominado o Rei do Rock, também conhecido pela alcunha de Elvis The Pelvis, apelido pelo qual ficou conhecido na década de 50 por sua maneira extravagante e ousada de dançar. Uma de suas maiores virtudes era a sua voz, devido ao seu alcance vocal, que atingia, segundo especialistas, notas musicais de difícil alcance para um cantor popular.\n\n        ', 'http://userserve-ak.last.fm/serve/252/48133595.png', 1, '59fdcc23d80983ce9863e7c2bd2f25bd', 0, '01809552-4f87-45b0-afff-2c6f0730a3be', 0, NULL),
(182, 'Elvis Costello', '\n                Declan Patrick Aloysius MacManus, nascido em 25 de agosto de 1954, mais conhecido pelo nome artístico de Elvis Costello, é um cantor, compositor e músico britânico. Teve participação nos primórdios do cenário pub rock (movimento concentrado no Norte de Londres e Sudeste do Condado de Essex que pregava uma volta ao básico, se colocando contra muito da cena pop da época, dominada pelo rock progressivo e por sons elaborados da costa oeste dos EUA), e mais tarde foi associado aos estilos punk rock e new wave, antes de se estabilizar como uma voz única e original nos anos 80.\n\n        ', 'http://userserve-ak.last.fm/serve/252/51594983.jpg', 1, '8f46396f5798903f99f12db5968d0c01', 0, '02f1d12d-b733-47f1-aba6-f4cc6d290eb7', 0, NULL),
(183, 'Jota Quest', '\n                Jota Quest é uma banda de M&aacute;rcio Buzelin juntaram-se ao grupo.\n\n        ', 'http://userserve-ak.last.fm/serve/252/80323357.png', 1, '64fbbab7d28f3589dface38788df3546', 0, '2759ea9d-07c9-4901-b764-5215a7c813d1', 0, NULL),
(184, 'Skank & Jota Quest', '', 'http://userserve-ak.last.fm/serve/252/41253651.jpg', 1, '836777285d6dd89320a784ca58d35fd1', 0, '', 0, NULL),
(185, 'Cazuza', '\n                Filho do produtor fonográfico João Araújo, e da dona-de-casa Maria Lúcia Araújo, o carioca Agenor de Miranda Araújo Neto, ou Cazuza, (Rio de Janeiro, Brasil, 4 de abril de 1958 - Rio de Janeiro, Brasil, 7 de julho de 1990) sempre teve contato com a música.   Influenciado desde pequeno pelos fortes valores da música brasileira, seu gosto musical ia de Cartola e Dolores Duran a Rolling Stones e Beatles. Começou a escrever letras e poemas por volta de 1965.  Cazuza entrou na Universidade em 1978, mas abandonou o curso de jornalismo três semanas depois, para trabalhar com seu pai na Som Livre. \n\n        ', 'http://userserve-ak.last.fm/serve/252/97084929.png', 1, 'd34bbfdf2bc50e2944c9ced61becdf95', 0, 'e554daf4-4ad0-438f-a7f9-832519451fd2', 0, NULL),
(186, 'Cazuza & Bebel Gilberto', '\n                Dois artistas extremamente importantes no MPB brasileiro, que com a música '' Preciso Dizer que Te Amo '' mostraram ter uma perfeita sintonia.  \n &quot;Agora eu queria apresentar, uma música de autoria de Dé, Bebel e Cazuza, chamada Eu Preciso Dizer Que Eu Te Amo... Bebel vai começar a cantar agora, por favor não façam barulho no ambiente! Muito obrigado... Maestro!...&quot;\n\n        ', 'http://userserve-ak.last.fm/serve/252/83413429.jpg', 1, '4f0b5fc666504de5b796cd503c95f0ea', 0, '', 0, NULL),
(187, 'Cássia Eller', '\n                Cássia Rejane Eller (Rio de Janeiro, 10 de dezembro de 1962 — Rio de Janeiro, 29 de dezembro de 2001) foi uma cantora e violonista do rock brasileiro dos anos noventa. Caracterizada por sua voz grave e pelo seu ecletismo musical, interpretou canções de grandes compositores do rock brasileiro, como Cazuza e Renato Russo, além de artistas da MPB como Caetano Veloso e Chico Buarque, passando pelo pop de Nando Reis e o incomum de Arrigo Barnabé e Wally Salomão, até sambas de Riachão e rocks clássicos de Jimi Hendrix, Beatles e Nirvana.\n \n\n        Cássia Eller on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/82771301.png', 1, '0a7fe5f8421e8faa9b7533df85157df2', 0, 'b3b9eb0c-d0b4-4570-b816-4e05e308b444', 0, NULL),
(189, 'Ana Carolina', '\n                Ana Carolina Souza, popularmente conhecida como Ana Carolina (Juiz de Fora, 9 de Setembro de 1974), é uma cantora, compositora, empresária, arranjadora, produtora e instrumentista brasileira de Pop, Pop Rock, Bossa Nova, Samba e MPB. Ganhadora de 4 Prêmio Multishow de Música Brasileira, 3 Troféu Imprensa e 1 Prêmio TIM de Música. De 1999 até hoje lançou nove álbuns e cinco Digital Versatile Disc, vendendo dois milhões de discos. Ela é uma das cantoras que mais venderam na década de 2000.  \n\n        ', 'http://userserve-ak.last.fm/serve/252/91711105.png', 1, 'e8383a89d2ccd0aececbece57f7d6be1', 0, 'f34f0700-1ae5-4b80-b506-252aeff31c71', 0, NULL),
(190, 'Ana Carolina & Seu Jorge', '\n                Celebrando o grande sucesso de Estampado, Ana Carolina lança Ana &amp; Jorge, o álbum que registra um show que a cantora fez em parceria com o cantor Seu Jorge em agosto de 2005, em São Paulo. Uma apresentação belíssima em formato acústico, possibilitando que os dois mostrassem suas canções de uma forma mais próxima à maneira como foram criadas. O repertório inclui “É Isso Aí”, uma versão de Ana para “Blower''s Daughter” (Damien Rice), do filme Closer, canções das carreiras solo de ambos e dois textos de Elisa Lucinda, musicados pela dupla: “Só de Sacanagem” e “Alfredo é Gisele”. \n\n        ', 'http://userserve-ak.last.fm/serve/252/3134749.jpg', 1, 'f78bc9bb10f00c2a4a5270d2d71b20a8', 0, '', 0, NULL),
(191, 'Cueio Limão', '\n                Da cidade de Dourados, interior do Mato Grosso do Sul, e nadando contra uma corrente que deixava o rock cada vez mais emocional, surgiu o Cueio Limão. Uma banda com nome estranho que fazia um rock simples e descompromissado, com uma forte pitada de humor, tornou-se um forte nome da cena hardcore independente.  Depois do sucesso absoluto do primeiro disco, Quem Matou o Bozo? (2004), mais de 4 mil cópias vendidas, inúmeros downloads (com destaque para os singles “Quem Matou O Bozo?”, “Prego” e “Maçarico''s Love Song”)...\n\n        ', 'http://userserve-ak.last.fm/serve/252/4458066.jpg', 1, '4d39437059caff43c2a852a81d6e53ec', 0, '0a5425ad-6529-4b8b-9639-20fc824502ab', 0, NULL),
(192, 'CUEIO LIMAO/Cueio Limão', '', '', 1, '97e134d5d86bd35f5187cabad5aff5ae', 0, '', 0, NULL),
(193, 'Lorde', '\n                Ella Maria Lani Yelich-O''Connor (Devonport, 7 de novembro de 1996), conhecida pelo seu nome artístico Lorde, é uma cantora e compositora neozelandesa. Seu primeiro single “Royals”. A canção também alcançou a posição #1 na parada Hot 100 da Billboard permanecendo em primeiro por 9 semanas consecutivas.\n\n        ', 'http://userserve-ak.last.fm/serve/252/101820225.png', 1, '31fe85ee055403d6e43657043c2b0ae3', 0, '8e494408-8620-4c6a-82c2-c2ca4a1e4f12', 0, NULL),
