(198, 'Pitty', '\n                Muse.  Cresceu em meio ao cenário de bandas baianas independentes e participou de várias rodas de shows em um bar de Salvador.\n\n        ', 'http://userserve-ak.last.fm/serve/252/101476123.png', 1, '2523d1a88b5c1e20084a6d467cfdfeaf', 0, '7cb38ec6-00d2-42e2-9b32-913faaf6d175', 0, NULL),
(199, 'Pitty Sing', '', 'http://userserve-ak.last.fm/serve/252/368948.jpg', 1, '710d2a13950b4d8b1eff91c83f96fc31', 0, 'fafecff5-94bd-45b5-b2f6-e9addc1214bc', 0, NULL),
(200, 'Basshunter', '\n                Basshunter é o nome artístico do músico e DJ sueco Jonas Erik Altberg, nascido em (Halmstad, Suécia, em 22 de dezembro de 1984. Basshunter descreve sua própria música como eurodance, enquanto outros podem também interpretá-la como electro, dance music e outro gêneros de música eletrônica. Ele se tornou famoso por suas músicas Botten Anna (sobre um bot de IRC) e Vi Sitter I Ventrilo Och Spelar DotA (sobre o mod do jogo Warcraft III chamado DotA Allstars, presente no patch Frozen Throne), em parte relacionado às suas referências à cultura geek.\n \n\n        ', 'http://userserve-ak.last.fm/serve/252/76015408.png', 1, '010d34dfb3da37fb53769b52a4153fda', 0, '255e2420-5b02-452b-9771-0512ebe78090', 0, NULL),
(201, 'Bassnectar', '\n                Bassnectar (nome real Lorin Ashton), DJ e produtor com sede em Santa Cruz Califórnia. a maioria dos generos tocados por Lorin são Dubstep.  Ele é conhecido por suas performances ao vivo e espectáculos de luz, e apoia activamente o grupo sem fins lucrativos Consciente Alliance .Bassnectar, nascido Lorin Ashton, participou Belarmino Preparatória College, em San Jose, Califórnia. No Belarmino, Ashton foi fortemente influenciado por grupos de heavy metal, como Metallica e Megadeth. Ele pegou essas influências e encaixou em sua carreira musical.\n\n        Bassnectar on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/41240411.jpg', 1, 'dc2d9ad385e63dfd991fc6ab5c1186b6', 0, '5d7c4cfc-29e7-4c83-8893-ae02679fc9f4', 0, NULL),
(202, 'Racionais Mc''s', '\n                Um dos principais grupos de rap e hip hop brasileiros, surgiu no final da década de 80 na periferia de São Paulo com um discurso contra a opressão às populações marginalizadas nas grandes metrópoles brasileiras. A primeira gravação foi em 1988, na coletânea &quot;Consciência Black&quot;. Dois anos depois, o primeiro disco solo, &quot;Holocausto Urbano&quot; levou o grupo a fazer uma série de shows pela Grande São Paulo, tornando-o mais conhecido.\n\n        ', 'http://userserve-ak.last.fm/serve/252/309651.jpg', 1, 'dd7cadbce0d20402ed3567fdb8ab34f1', 0, '', 0, NULL),
(203, 'Cajun Dance Party', '\n                Cajun Dance Party são um quinteto de indie rock de Londres, Inglaterra, formado em 2005. Seus membros são Daniel Blumberg (vocais), Vicky Freund (teclados), Max Bloom (baixo), Robbie Stern (guitarra) e Will Vignoles (bateria), filho de músico clássico Roger Vignoles.\n \n\n        Cajun Dance Party on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/5641309.jpg', 1, '90b3dcd2b55f0ad43b0ef8b80226e8bd', 0, 'bb9b2f6f-0cdd-45e2-88b2-e04c13c3d4f6', 0, NULL),
(204, 'Cajus', '', 'http://userserve-ak.last.fm/serve/252/24162739.jpg', 1, 'fda019efea6c99be9b9b0f9f154159e2', 0, '2c876f35-d63f-42b7-8f06-cea16d0b84a2', 0, NULL),
(205, 'Caju e Castanha', '\n                Ver Caju &amp; Castanha.\n Organize suas tags!\n\n        Caju e Castanha on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/347463.jpg', 1, '5ab1f1c4240dc4bb491c6f861041fd0e', 0, '', 0, NULL),
(206, 'Cajú e Castanha', '\n                Ver Caju &amp; Castanha.\n Organize suas tags!\n\n        Cajú e Castanha on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/27290611.jpg', 1, '3b03e14df82ec766848311c6555bb3cd', 0, 'ced8aed1-aa3e-44b3-8249-c26476c94468', 0, NULL),
(207, 'Nicole Scherzinger', '\n                Nicole Prescovia Elikolani Valiente Scherzinger, mais conhecida como Nicole Scherzinger (Honolulu, Hawaí, em 29 de Junho de 1978), pode ser descrita como uma das cantoras mais versáteis da atualidade, com um enorme potencial vocal que a permite ir a ópera ao POP com sublimidade. Além disso, é uma excelente compositora, dançarina, e atriz estadunidense que ficou mundialmente conhecida após tornar-se líder de um dos maiores grupos femininos de todos os tempos, The Pussycat Dolls que, ao todo,  já vendeu mais de 15 milhões de cópias pelo mundo com apenas dois álbuns lançados.\n\n        ', 'http://userserve-ak.last.fm/serve/252/101692637.png', 1, '799d26e2e76e2129c2e5466a25a5090a', 0, '0a390d85-5bb7-4161-a615-aad48962aabd', 0, NULL),
(208, 'Nicola Conte', '\n                Como qualquer músico profissional com um passado ligado à música electrónica e ao acid-jazz, Nicola Conte é um colecionador inveterado de discos, raridades em vinil que lhe permitam encontrar novos projectos e sonoridades. Para o álbum ''Other Directions'', foi buscar referências ao jazz dos anos 50 e 60, época em que este género musical começou a desprender-se das fórmulas clássicas das big bands norte-americanas.  \n\n        ', 'http://userserve-ak.last.fm/serve/252/10485317.jpg', 1, '18c6979d1ebe7031b199cf2f3936d374', 0, 'e390d54f-92f0-4039-9dd3-e8eac130b4c0', 0, NULL),
(209, 'P. Diddy & The Bad Boy Family', '', 'http://userserve-ak.last.fm/serve/252/366060.jpg', 1, 'a74891a2dd6e2db89abd1ce7ca9ce346', 0, '', 0, NULL),
(210, 'T.I. Presents THE P$C', '', 'http://userserve-ak.last.fm/serve/252/90594179.png', 1, '0b300a46b595621dfc6b813e80e13d7a', 0, '', 0, NULL),
(211, 'The Smashing Pumpkins', '\n                O Smashing Pumpkins surgiu em Chicago no ano de 1988. Criada pelos guitarristas Billy Corgan e James Iha, a banda chegou ao auge em 1995 com o lançamento do álbum &quot;Mellon Collie and the Infinite Sadness&quot; - um dos álbuns duplos mais vendidos da história.  Menos influenciados pelo punk rock que outras bandas contemporâneas, a banda era baseada em sons pesados de guitarra, contendo elementos de gothic rock, heavy metal, música psicodélica, rock progressivo, pós-punk e, posteriormente, música eletrônica.\n\n        ', 'http://userserve-ak.last.fm/serve/252/887234.jpg', 1, '7429e147cc2d9d61550a79cb537ce4aa', 0, '2b42ec56-6785-4ed8-b3cb-190f750111bb', 0, NULL),
(212, 'The Pussycat Dolls', '\n                The Pussycat Dolls foi um grupo musical feminino de Carmit Bachar. \n \n\n        ', 'http://userserve-ak.last.fm/serve/252/9792509.jpg', 1, '16a7471ed7d5083e2bd60ef8824c703d', 0, '1fda852b-92e9-4562-82fa-c52820a77b23', 0, NULL),
(213, 'R. Kelly & Jay-Z', '', 'http://userserve-ak.last.fm/serve/252/62503751.jpg', 1, '3e6a210b96bd7741974b43bc3b79b90d', 0, '', 0, NULL),
(214, 'Jay-R', '', 'http://userserve-ak.last.fm/serve/252/46094155.jpg', 1, 'bc00c7175e30bdd5ae156ad303a32867', 0, '40533992-32d0-41c8-9539-1d609d7af263', 0, NULL),
(215, 'Ja Rule', '\n                Ja Rule, nome artístico de Jeffrey Atkins, (Nova Iorque, 29 de fevereiro de 1976) é um rapper e ator norte-americano.  História  Aos quinze anos Ja Rule fugiu de sua escola e se envolveu com o tráfico de drogas por sete anos. A reviravolta em sua vida ocorreu em 1998, quando seu vizinho Irv Gotti criou o selo Murder Inc. e o contratou. Logo, com o seu enorme talento nas rimas, Ja Rule se destacou na gravadora Murder Inc.\n\n        ', 'http://userserve-ak.last.fm/serve/252/74774672.png', 1, '5498eb4f5d9d3744a2ce3f2fc2c6a46f', 0, 'b504f625-4ef6-4a5a-81e8-870a61e8dc9c', 0, NULL),
(216, 'Run-D.M.C. vs. Jason Nevins', '', 'http://userserve-ak.last.fm/serve/252/212659.jpg', 1, '0d64f4ea9fae19cf6e250ee0da2ac13c', 0, '', 0, NULL),
(217, 'Joshua Henry, Mary Faber, Leslie McDonel, Christina Sajous, Alysha Umphress, Libby Waters & Company', '', 'http://userserve-ak.last.fm/serve/252/45382467.jpg', 1, '3b97d83a380a2146acb5265716cc2c02', 0, '', 0, NULL),
(218, 'Rebecca Naomi Jones, Mary Faber, Leslie McDonel, Christina Sajous, Alysha Umphress & Libby Winters', '', 'http://userserve-ak.last.fm/serve/252/47308029.jpg', 1, '93d5b9843e7ee44c4eae80adf804467c', 0, '', 0, NULL),
(219, 'Um Joystick, Um Violão', '\n                Um Joystick, Um Violão trata-se de um projeto musical elaborado por Marcos Castro e Matheus Castro (os &quot;Castro Brothers&quot;), iniciado em meados de 2011, no qual são feitas paródias de músicas famosas tocadas com letras baseadas em elementos de games.\n\n        ', 'http://userserve-ak.last.fm/serve/252/80477115.jpg', 1, '9ebb6d3a73406c82d6c1b83bfe3dcba2', 0, '', 0, NULL),
(220, 'Um Joystick, Um Violão', '', 'http://userserve-ak.last.fm/serve/252/80383443.jpg', 1, '59fdd809cedd68ebd93b801fec49e8ae', 0, '', 0, NULL),
(221, 'Titãs', '\n                Titãs é uma banda de rock brasileira formada em São Paulo na década de 1980, uma das mais bem-sucedidas comercialmente e influentes no Brasil dos últimos 30 anos, ao lado de Legião Urbana, Os Paralamas do Sucesso e Barão Vermelho. Entre suas músicas mais famosas estão Sonífera Ilha, Flores, Diversão, Bichos Escrotos, Polícia, Comida, Marvin, Epitáfio e Porque eu sei que é amor.  No fim dos anos 70, em plena ditadura militar, um colégio em São Paulo se tornou um dos poucos pontos de resistência cultural.\n\n        ', 'http://userserve-ak.last.fm/serve/252/3974965.jpg', 1, '2b5d823445a55119a81e008581cb9909', 0, 'c1a669b9-30f4-4171-a2a9-a15d9461ca04', 0, NULL),
(222, 'Paralamas e Titãs', '\n                Em 1982, quase ninguém imaginaria o rock ocupando um espaço tão grande no cenário cultural brasileiro. Mas hoje não se discute, é história: nos últimos 25 anos, o gênero conquistou relevância e importância ímpares no país. Parte substancial desse crescimento em popularidade e em qualidade pode ser creditada a Os Paralamas do Sucesso e Titãs.\n Mas história não termina nunca, é um processo permanente.\n\n        ', 'http://userserve-ak.last.fm/serve/252/7488143.jpg', 1, '46f99c937c1625a3671fe7d9a343e91b', 0, '', 0, NULL),
(223, 'Ventania', '\n                Ventania, nome artístico de Wilson da Silva (Pariqüeraçu, 21 de agosto de 1962), é um cantor andarilho cuja inspiração vem do movimento hippie, dos anos 60 e 70. Atualmente mora em São Thomé das Letras.\n Uma das mais importantes influências musicais de Ventania é o cantor e compositor Raul Seixas, o &quot;Raulzito&quot;, marco histórico do rock nacional e da mistura com influências &quot;alternativas&quot;.\n Ventania é separado e tem oito filhos, segundo ele.\n\n        ', 'http://userserve-ak.last.fm/serve/252/89908779.png', 1, '2a3013ee8969512cc8cf9bf613ca047a', 0, '20df7feb-5b94-4b51-be35-7da7da440e9b', 0, NULL),
(224, 'Ventana', '\n                Myspace.com/ VENTANA  Members:\n Richard Thomas - Programmimg,Synths,Samples, Vocals\n Scott Beck - Vocals\n Daniel Fox - Drums\n Rocky Sobon - Guitar\n John Dobosh - Bass  ABOUT THE BAND\n Self Produced with the help of MUSHROOMHEADs mastermind Steve “skinny” Felton, their collaborations contain the influences and professionalism to be expected from such affiliations. VENTANA represents a time where we see not only the past, but also a slight reflection of our future in the dusty glass.\n\n        ', 'http://userserve-ak.last.fm/serve/252/52876045.jpg', 1, '1ac2434548f4ab66dcc22de295b5f332', 0, '1a0e3a3c-ba7d-4d11-923b-e5390484a8e5', 0, NULL);
INSERT INTO `Artista` (`ArtistaId`, `Titulo`, `Descricao`, `Imagem`, `Ativo`, `md5`, `Visitas`, `mbid`, `AplicacaoId`, `Relacionados`) VALUES
(225, 'Caesars', '\n                O The Caesars, ou Caesars Palace (nome mais utilizado na Suécia), é uma banda composta por quatro rapazes revoltados com o trance e drum''n''bass dominantes nas noites de Estocolmo: César Vidal (vocais), Jocke Ahrklend (guitarra), David Lindquist (baixo) e Nino Kellar (bateria).  Em 1998 lançaram seu álbum de estréia: ''Youth is Wasted On the Young''. Segundo a banda, suas músicas favoritas do disco são: ''Sort It Out'' e ''Anything You Want''.\n\n        ', 'http://userserve-ak.last.fm/serve/252/77267594.png', 1, '41b386b9cd621a330cb84ba92f287bc9', 0, '2f1e4ada-2b9a-4834-90fa-88d61b73082f', 0, NULL),
(226, 'Caetano Veloso', '\n                Caetano Emanuel Viana Teles Veloso (Santo Amaro da Purificação, 7 de agosto de 1942) é um dos mais populares e influentes compositores e cantores brasileiros.  Nascido na Bahia, é o quinto de sete crianças filhos de José Teles Veloso (Seu Zezinho) e Claudionor Viana Teles Veloso (Dona Canô). Foi ele que escolheu o nome para a irmã (a sexta filha), inspirado numa canção famosa da época (18 de junho de 1946) de Maria Beth&acirc;nia.\n\n        ', 'http://userserve-ak.last.fm/serve/252/91163365.png', 1, 'acbd0feb71cb82e03e135792467b4f7c', 0, 'f07dbc2f-317b-470f-bad4-5f1b0eb6faf1', 0, NULL);
